import CustomButton from "../../components/custom-button/custom-button.component";
import {Link} from 'react-router-dom'
import './homepage.styles.scss'
const HomePage = () => {
  return (
    <div className='homepage'>
      <div className="title">WIN MONEY BETTING ON CUSTOM FANTASY MATCHUPS</div>
      <div className="sub-header">Sign up, or set your lineup first</div>
      <CustomButton>Sign Up</CustomButton>
      <Link className='set-lineup-link' to='/set-lineup'>Set lineup and view odds</Link>
    </div>
  );
};

export default HomePage;
